import logo from './logo.svg';
import './App.css';
import {ReportTemplate} from "./Templates/ReportTemplate"
import {Title} from "./MainPage";
import {Description} from "./MainPage";

function App() {
  return (
    <div className="App">
        <Title>
            <Description/>
        </Title>
      <ReportTemplate/>
    </div>
  );
}

export default App;
